@Caio Salazar sim, estamos supondo o que aconteceu na realidade. Nunca confie em declarações da China. Não são anti democráticos a toa. 
Os especialistas da mais diversas áreas só confiam em dados da China que possam comprovar ou que fazem muito sentido, de resto, um olhar com desconfiança é o mais indicado.
Quando digo China, digo sobre o dados do governo. O povo normalmente trabalha de um jeito diferente, muito mais na base da confiança, vide as operações de importação e exportação.

